import React, { Component } from 'react';
import './App.css';
import styles from './mystyle.module.css'
import { Switch, Route, Redirect } from "react-router-dom";

class CustomRouting extends Component {
//TODO : ADD Footer information

componentDidMount(){
// set UserName
var userName = this.props.location.state.userName;
}



  render() {
    return (
      <div>

      <Switch>
             <Route exact path="/index" component={MainIndex} />
             {userName ? (
               <Route exact path="/restricted" component={RestrictedPage} />
             ) : (
               <Redirect to="/login" />
             )}
             {userName === "teacher" ? (
               <Route exact path="/only-teacher" component={OnlyTeacher} />
             ) : (
               <Redirect to="/index" />
             )}
             {userName === "student" ? (
               <Route exact path="/only-student" component={OnlyStudent} />
             ) : (
               <Redirect to="/index" />
             )}
             <Route exact path="/login" component={LoginPage} />
           </Switch>

     </div>

    );
  }
}
export default CustomRouting;
